/**
 * 提示框包装
 * @param {*} param0
 * @returns
 */
export const ToolWrapper = ({ children, title }) => {
    const [open, setOpen] = useState(false);
    const handleMouseEnter = () => {
        setOpen(true);
    };
    const handleMouseLeave = () => {
        setOpen(false);
    };
    const click = () => {
        setOpen(false);
    };
    const handleChild = Children.map(children, child => {
        const { onClick } = child.props;
        const handleClick = e => {
            click();
            onClick?.(e);
        };
        return cloneElement(child, { onClick: handleClick, onMouseEnter: handleMouseEnter, onMouseLeave: handleMouseLeave });
    });

    return (
        <Tooltip title={title} open={open}>
            {handleChild}
        </Tooltip>
    );
};
const BaseIcon = ({ children, title, hiddenTooltip = false, ...rest }) =>
    !hiddenTooltip ? (
        <ToolWrapper title={title}>
            <Icon
                component={() => (
                    <svg xmlns="http://www.w3.org/2000/svg" width="1em" height="1em" viewBox="0 0 896 896" fill="currentColor">
                        {children}
                    </svg>
                )}
                {...rest}
            ></Icon>
        </ToolWrapper>
    ) : (
        <Icon
            component={() => (
                <svg xmlns="http://www.w3.org/2000/svg" width="1em" height="1em" viewBox="0 0 896 896" fill="currentColor">
                    {children}
                </svg>
            )}
            {...rest}
        ></Icon>
    );
